import { combineReducers} from 'redux'
import {userReducer} from "./userReducer";
import {UserAction, userState} from "../../types/todo";


interface Reducer<T, U> {
}

export const rootReducer: Reducer<{ user: userState}, UserAction> = combineReducers({
    user: userReducer,
})
